¿Aburrido de comer pollo? 😐🍗.
.
Les traigo una receta diferente de muslos de pollo para variar el menú en casa durante la cuarentena 🍗.
_
MUSLOS DE POLLO EN SALSA INGLESA 🍴.
.
INGREDIENTES:
▫️De 4 a 6 de muslos de pollo 🍗.
▫️1 taza de vinagre de vino tinto.
▫️1/2 taza de salsa inglesa de @productos.keiko ❣️.
▫️2 dientes de ajo 🧄.
▫️2 cebollas 🧅.
▫️Sal y pimienta de @productos.keiko al gusto 🧂.
▫️papás pequeñas de acompañamiento (opcional) 🥔.
▫️Perejil fresco.
.
PROCEDIMIENTO:
▫️Coloca el pollo en un recipiente e incorpora el vinagre, sal, pimienta, salsa inglesa @productos.keiko y el ajo picado 🧄.
▫️Colócalo en la nevera tapado por 30 minutos.
▫️ Colócale luego, las cebollas troceadas en tiras y coloca en el horno en 200 grados por aproximadamente 30 minutos o hasta que el pollo esté cocido 🍗.
▫️ Aparte, hierve las papas y cuando estén cocidas, córtalas de la manera que gustes y colócalas en el horno por 10 minutos o hasta qué doren 🥔.
▫️ Una vez que tengas todo listo, sólo queda servir el pollo con salsa inglesa de @productos.keiko acompañado de papas cocidas y unas hojas de perejil fresco por encima 🥰.
.
...¡Bon Appetit!...
.
.
