Una pelota de béisbol tiene que ser dura, pero también tiene que tener un poco de rebote. A diferencia de otras tantas pelotas deportivas, no están llenas de aire, pero sí con una combinación de corcho, caucho, lana y piel. ⚾
.
Cada pelota de béisbol es enrollada con casi 370 metros de cordel de lana sobre el corcho y el caucho en múltiples etapas, siendo cada etapa de diferente grosor y color. Los diferentes colores identifican las diferentes etapas de devanado de lana en la pelota por los fabricantes .
.
Las pelotas de béisbol del siglo XIX tenían poca uniformidad (eran de fabricación casera) pero con el tiempo se dio paso a pelotas hechas de fábrica que tenían un núcleo de goma. La pelota con núcleo de corcho se introdujo a partir de 1910 y se convirtió en la norma. Desde entonces ha cambiado muy poco.
.
